import { useEffect, useState } from 'react';
import { Modal } from '../modalComponent/modalComponent.tsx';
import React from 'react';

interface Props {
    isOpen: boolean;
    onClose: () => void;
  }

  const RestaurantModal: React.FC<Props> = ({isOpen, onClose }) => {
    // Restante do código do componente RestaurantModal
  
    return (
      <div>
        {/* Restante do código do componente RestaurantModal */}
        <Modal open={isOpen} onClose={onClose} title="Título do Modal">
          {/* Conteúdo do modal */}
        </Modal>
      </div>
    );
  };
  
  export default RestaurantModal;
